contracts/libraries/SponsorWhitelistCont.content:
pragma solidity >=0.4.15;

contract SponsorWhitelistControl {
function c_0x2de1b871(bytes32 c__0x2de1b871) public pure {}

  /*** Query Functions ***/
  /**
    * @dev get gas sponsor address of specific contract
    * @param contractAddr The address of the sponsored contract
    */
  function getSponsorForGas(address contractAddr) public view returns (address) {c_0x2de1b871(0x2d5cde38fa8db747abee1edce0c2a23f91f1ade30de9e1e007026e8b8212cb46); /* function */ 
}

  /**
    * @dev get current Sponsored Balance for gas
    * @param contractAddr The address of the sponsored contract
    */
  function getSponsoredBalanceForGas(address contractAddr) public view returns (uint) {c_0x2de1b871(0x228833b9acbfa250addb2a35ebe5d046dfb47116387847bb1052a89c1dadbc22); /* function */ 
}

  /**
    * @dev get current Sponsored Gas fee upper bound
    * @param contractAddr The address of the sponsored contract
    */
  function getSponsoredGasFeeUpperBound(address contractAddr) public view returns (uint) {c_0x2de1b871(0x883b891d00d91c2724fca0d4f8af48aa120dbff2be41b41e841ce2ba9a9092be); /* function */ 
}

  /**
    * @dev get collateral sponsor address
    * @param contractAddr The address of the sponsored contract
    */
  function getSponsorForCollateral(address contractAddr) public view returns (address) {c_0x2de1b871(0x9c1b3250ad745e854f8ca90b79c723de2b0581b1356bc9dce2794b21a93da1d4); /* function */ 
}

  /**
    * @dev get current Sponsored Balance for collateral
    * @param contractAddr The address of the sponsored contract
    */
  function getSponsoredBalanceForCollateral(address contractAddr) public view returns (uint) {c_0x2de1b871(0xe0699cdcd658589a4345da8a7785f63cbc873be6959e0a5e45d5ef40a5880dff); /* function */ 
}

  /**
    * @dev check if a user is in a contract's whitelist
    * @param contractAddr The address of the sponsored contract
    * @param user The address of contract user
    */
  function isWhitelisted(address contractAddr, address user) public view returns (bool) {c_0x2de1b871(0x41f511865e135a2ffbd3cb400a77d4e53872c469f6c8b49a1f7dbe3944bef55a); /* function */ 
}

  /**
    * @dev check if all users are in a contract's whitelist
    * @param contractAddr The address of the sponsored contract
    */
  function isAllWhitelisted(address contractAddr) public view returns (bool) {c_0x2de1b871(0xa62df9db57065a7bf7a4f0e3865f10cd5a3c0a619ce779d5e8bfa25a6eb39de8); /* function */ 
}

  /*** for contract admin only **/
  /**
    * @dev contract admin add user to whitelist
    * @param contractAddr The address of the sponsored contract
    * @param addresses The user address array
    */
  function addPrivilegeByAdmin(address contractAddr, address[] memory addresses) public {c_0x2de1b871(0xe56cd90f745e748503656770048eef8bc7be6c1fd9170d9dbbdfa5c417dde1a4); /* function */ 
}

  /**
    * @dev contract admin remove user from whitelist
    * @param contractAddr The address of the sponsored contract
    * @param addresses The user address array
    */
  function removePrivilegeByAdmin(address contractAddr, address[] memory addresses) public {c_0x2de1b871(0xe3513bbee5d66693b50face2097649cce14028a0299ad00b32eb53661b874660); /* function */ 
}

  // ------------------------------------------------------------------------
  // Someone will sponsor the gas cost for contract `contractAddr` with an
  // `upper_bound` for a single transaction.
  // ------------------------------------------------------------------------
  function setSponsorForGas(address contractAddr, uint upperBound) public payable {c_0x2de1b871(0xcb57fa0ceca4a7501b6d67569e4be6530f5e63869f8218b9f464f8c47055aa74); /* function */ 
}

  // ------------------------------------------------------------------------
  // Someone will sponsor the storage collateral for contract `contractAddr`.
  // ------------------------------------------------------------------------
  function setSponsorForCollateral(address contractAddr) public payable {c_0x2de1b871(0x9ff44f11fa62868e2fe72f147455d7e43e517905de16efe8cdc98355633e0f63); /* function */ 
}

  // ------------------------------------------------------------------------
  // Add commission privilege for address `user` to some contract.
  // ------------------------------------------------------------------------
  function addPrivilege(address[] memory) public {c_0x2de1b871(0x607dcf830e92ffa023c1d2f3b79b736fc6ffa29df377a80c5798bfa5f627d9ad); /* function */ 
}

  // ------------------------------------------------------------------------
  // Remove commission privilege for address `user` from some contract.
  // ------------------------------------------------------------------------
  function removePrivilege(address[] memory) public {c_0x2de1b871(0xde210e062e48be021df089f102cc3a64fe6fce8410fbe554da31c87b3bb7eea9); /* function */ 
}
}

